var helpContent;
function initialiseHelp()
{
    helpContent="";
    helpContent = helpContent + "<h2>Scattering of Light experiment help</h2>";
    helpContent = helpContent + "<h3>About the experiment</h3>";
    helpContent = helpContent + "<p>The experiment demonstrates scattering of white light by a colloidal solution of sodium thiosulphate and sulphuric acid in water.</p>";
    helpContent = helpContent + "<p>You can enter the animation stage by clicking the start button. On the screen, you can see two convex lens(used for making the rays of light parallel to each other), screen for projection of light rays, glass of water and the point source of light.</p>";
    helpContent = helpContent + "<p>You can see that rays start emerging from the torch. When the diverging rays reach the convex lens, they become parallel to the principal axis. They pass through the tumbler of water and converge on the wall because of the second set of convex lenses.</p>";
	helpContent = helpContent + "<h3>The animation stage</h3>";
    helpContent = helpContent + "<p>Step 1: Click the start button and watch as the white rays of light converge on the wall. </p>";
    helpContent = helpContent + "<p>Step 2: After the rays reach the wall, Reposition i.e. drag and drop the petri dish of Na2S2O3 over the tumbler of water and press the start button to progress the experiment.</p>";
	helpContent = helpContent + "<p> Watch as the sodium thiosulfate drops into the tumbler.</p>";
	helpContent = helpContent + "<p>Step 3: Now position the beaker of H2SO4 over the tumbler of water and press the start button.</p>";
	helpContent = helpContent + "<p>Watch as sulphuric acid drops in the tumbler of water drop by drop. </p>";
	helpContent = helpContent + "<p>Now, sulphuric acid is added to water and colloidal sulphur is formed</p>";
    helpContent = helpContent + "<p>We see that the the colour of water solution changes. And the rays of light focused on the screen can be seen undergoing scattering phenomenon.</p>";
    helpContent = helpContent + "<h2>Happy Experimenting!</h2>";
    PIEupdateHelp(helpContent);
}


var infoContent;
function initialiseInfo()
{
    infoContent =  "";
    infoContent = infoContent + "<h2>Scattering of light experiment concepts</h2>";
    infoContent = infoContent + "<h3>About the experiment</h3>";
    infoContent = infoContent + "<p>The experiment demonstrates scattering of white light by a colloidal solution of sodium thiosulphate and sulphuric acid in water.</p>";
    infoContent = infoContent + "<h3>Scattering of Light</h3>";
	infoContent = infoContent + "<p>When we add only sulphuric acid or only sodium thiosulfate, nothing happens but when we add sodium thiosulfate and sulphuric acid one after the other ,together, a colloidal solution gets formed.";
    infoContent = infoContent + "<p>Colloidal suspensions scatter white light strongly. </p>";
    infoContent = infoContent + "<p>In this demonstration, colloidal sulfur is generated by the reaction of sodium thiosulfate and hydrochloric acid in a two- step process involving first the formation of thiosulfuric acid followed by its decomposition to sulfurous acid and colloidal sulfur.</p>";
    infoContent = infoContent + "<p>2 H+ (aq) + S2O32- (aq) --> H2S2O3 (aq)</p>";
    infoContent = infoContent + "<p>H2S2O3 (aq) --> H2SO3 (aq) + colloidal sulfur</p>";
    infoContent = infoContent + "<p>Shorter wavelengths are scattered more while longer wavelengths (reds and oranges) are transmitted. Scattering is when a molecule absorbs a photon of light, exciting an electron into a higher energy state.</p>";
    infoContent = infoContent + "<p>When the electron returns to a lower energy state, the molecule emits a photon in a random direction. This randomness produces the scattering known as the TYNDALL effect.</p>";
    infoContent = infoContent + "<p>As the sulfur precipitates the higher energy light from the point source pf light will be scattered, making the solution look blue.</p>";
    infoContent = infoContent + "<p>Red and orange light transmitted through the solution will be projected onto the screen.</p>";
    infoContent = infoContent + "<p>The colors observed during a natural sunset and sunrise are a result of the same principle. </p>";
    infoContent = infoContent + "<h2>Happy Experimenting!</h2>";
    PIEupdateInfo(infoContent);
}



